description:
Verenigde Staten
Actie / Thriller
87 minuten

goed

met Ray Wise, Dana Ashbrook en Derek Mears

Misdaad baas Reg Bellavance wordt beschuldigd van moord en zal waarschijnlijk de gevangenis in moeten. Nu hij vrij is op 
borgtocht wil hij samen met zijn zoon de stad verlaten. Het enige probleem is dat het geld dat hij verborgen heeft voor zulke 
omstandigheden verdwenen is. Bellavance geeft zijn rechterhand daarom een simpele opdracht: Vind het geld, vermoord iedereen die 
met de diefstal te maken heeft en maak het vooral bloederig.
